// SPDX-License-Identifier: MIT
pragma solidity 0.8.9;

/*
  ZOOM to Game world bridge
  Copyright 2023 Cardinal Entertainment 1000011333 Ontario Inc.
*/

import "./ZoomToken.sol";

contract ZoomBridge is Ownable, Pausable {

    address public zoomContract;
    uint256 public zoomRate = 100000;

    event zoomBridged(
        uint256 zoomAmount,
        string playerUUID
    );

    constructor(address _zoomContract) {
        zoomContract = _zoomContract;
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function setZoomContract(address _zoomContract) external onlyOwner {
        zoomContract = _zoomContract;
    }

    function setZoomRate(uint256 _zoomRate) external onlyOwner {
        require(_zoomRate > 0, "Rate must be greater than 0");
        zoomRate = _zoomRate;
    }

    //Buy Zoom credits with GLMR, transfer the GLMR to the owner
    function buyZoomCredits(string memory _player) whenNotPaused external payable {
        require(msg.value > 0.00001 ether, "Amount must be higher than 0.00001");
        require(bytes(_player).length == 36, "Player must be a valid UUID");
        uint256 zoomAmount = msg.value * zoomRate;
        payable(owner()).transfer(msg.value);
        emit zoomBridged(zoomAmount, _player);
    }

    // Bridge function to burn ZOOM tokens and mint in game currency
    function bridgeZoom(string memory _player, uint256 _amount) whenNotPaused external {
        require(_amount > 0 , "Amount must be greater than 0");
        require(isWholeNumber(_amount), "Amount cannot be decimals");
        require(bytes(_player).length == 36, "Player must be a valid UUID");
        ZoomToken(zoomContract).burnZoom(msg.sender, _amount); //burn the tokens
        emit zoomBridged(_amount, _player);
    }

    // Helper function to check if the provided value (in wei) is a whole number in ethers
    function isWholeNumber(uint256 valueInWei) public pure returns (bool) {
        return valueInWei % 1 ether == 0;
    }
}
